import './descriptionTextBox.css'

export default function DescriptionTextBox(props)
{
    return(
        <div id="descriptionTextBox">
            <h1 id="desctiptionHeader">{props.title}</h1>
            <div id="description">
                {props.des}
            </div>
        </div>
    )
}
